// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./interfaces/IGame.sol";

// Add Ragnarok interface at top of file
interface IRagnarok {
    function getRegisteredPlayers() external view returns (address[] memory);
}

contract GameMaster is Ownable {
    // State variables
    address[] public players;
    mapping(address => bool) public isRegistered;

    // Game registry
    mapping(string => address) public gameAddresses;
    mapping(string => bool) public isGameRegistered;
    string[] public registeredGames;

    // Active game tracking
    uint256 public activeGameCount;
    mapping(uint256 => address) public activeGames;

    // Player numbers
    mapping(address => uint256) public playerNumbers;

    // Add Ragnarok contract address
    address public ragnarokAddress;

    // Add event for Ragnarok address updates
    event RagnarokAddressUpdated(address newAddress);

    // Events
    event PlayersRegistered(address[] players);
    event GameRegistered(string gameName, address gameAddress);
    event GameStarted(string gameName, address gameAddress, uint256 gameId);
    event PlayerNumberAssigned(address indexed player, uint256 number);

    constructor() Ownable(msg.sender) {}

    // Register a new game type (owner only)
    function registerGame(string calldata gameName, address gameAddress) external onlyOwner {
        require(gameAddress != address(0), "Invalid game address");
        require(!isGameRegistered[gameName], "Game already registered");
        require(bytes(gameName).length > 0, "Game name cannot be empty");

        gameAddresses[gameName] = gameAddress;
        isGameRegistered[gameName] = true;
        registeredGames.push(gameName);

        emit GameRegistered(gameName, gameAddress);
    }

    // Start a new game instance
    function initializeGame(string calldata gameName) external onlyOwner returns (uint256) {
        require(isGameRegistered[gameName], "Game not registered");
        require(players.length > 0, "No players registered");

        address gameAddress = gameAddresses[gameName];
        IGame game = IGame(gameAddress);

        // Validate all players have numbers
        for (uint i = 0; i < players.length; i++) {
            require(playerNumbers[players[i]] != 0 || players[i] == players[0], 
                "Player missing number assignment");
        }

        // Create array of player numbers in same order as players array
        uint256[] memory playerNumbersArray = new uint256[](players.length);
        for (uint256 i = 0; i < players.length; i++) {
            playerNumbersArray[i] = playerNumbers[players[i]];
        }

        // Initialize new game instance
        game.initialize(players, playerNumbersArray);

        // Track active game
        uint256 gameId = activeGameCount++;
        activeGames[gameId] = gameAddress;

        emit GameStarted(gameName, gameAddress, gameId);
        return gameId;
    }

    // Add function to set Ragnarok address
    function setRagnarokAddress(address _ragnarok) external onlyOwner {
        require(_ragnarok != address(0), "Invalid Ragnarok address");
        ragnarokAddress = _ragnarok;
        emit RagnarokAddressUpdated(_ragnarok);
    }

    // Update registerPlayers to pull from Ragnarok
    function registerPlayers() external onlyOwner {
        require(ragnarokAddress != address(0), "Ragnarok address not set");

        // Get players from Ragnarok
        IRagnarok ragnarok = IRagnarok(ragnarokAddress);
        address[] memory _players = ragnarok.getRegisteredPlayers();
        require(_players.length > 0, "No registered players in Ragnarok");

        // Clear existing data
        delete players;
        // Clear all registered status and player numbers
        for (uint i = 0; i < players.length; i++) {
            isRegistered[players[i]] = false;
            delete playerNumbers[players[i]];
        }

        // Register each player
        for (uint i = 0; i < _players.length; i++) {
            address player = _players[i];
            require(player != address(0), "Invalid player address");

            // Assign player number (index in the array)
            playerNumbers[player] = i;
            players.push(player);
            isRegistered[player] = true;
        }

        emit PlayersRegistered(_players);
    }

    // View functions
    function getRegisteredGames() external view returns (string[] memory) {
        return registeredGames;
    }

    function getPlayers() external view returns (address[] memory) {
        return players;
    }

    function getPlayerCount() external view returns (uint256) {
        return players.length;
    }

    function getPlayerInfo(address player) external view returns (string memory gameName, uint256 gameId) {
        if (!isRegistered[player]) {
            return ("", 0);
        }

        // Get all registered games
        for (uint256 i = 0; i < registeredGames.length; i++) {
            string memory currentGameName = registeredGames[i];
            address gameAddress = gameAddresses[currentGameName];

            if (gameAddress != address(0)) {
                IGame game = IGame(gameAddress);
                uint256 playerGameId = game.getPlayerGameId(player);

                if (playerGameId != 0) {
                    return (currentGameName, playerGameId);
                }
            }
        }

        return ("", 0);
    }

    function startGames(string calldata gameName) external onlyOwner returns (bool) {
        require(isGameRegistered[gameName], "Game not registered");
        IGame game = IGame(gameAddresses[gameName]);
        return game.startGames();
    }

    function endExpiredGames(string calldata gameName) external onlyOwner {
        require(isGameRegistered[gameName], "Game not registered");
        IGame game = IGame(gameAddresses[gameName]);
        game.endExpiredGames();
    }

    // Add convenience function to get player number
    function getPlayerNumber(address player) external view returns (uint256) {
        require(isRegistered[player], "Player not registered");
        return playerNumbers[player];
    }
}

